    let navigate = useNavigate();
   

    const isdisabled = true; 

    handleChange = (e) => {
        if(e.target.value.length >=0) {
            this.setState({
                isdisabled: false
            });
        } else {
            this.setState({
                isdisabled: true
            });
        }
    }
    
    const toRegister = () =>{ 
        let path = `register`; 
        navigate(path);
    }

  return (
    <Grid container spacing={2}>
         <Grid item xs={12}>
         <h1>Login</h1>
         <h2>Please enter your details to log into your account.</h2>
  </Grid>
  <Grid item xs={4}>
  </Grid>
  <Grid item xs={8}>
    <li>
    <input
     type='text'
    placeholder='Email here'
    value={this.props.email}
    onChange={e =>{this.props.handleEmail(e); this.handleChange(e)}}
    />
    <input
    type='password'
    placeholder='Password here'
    value={this.props.password}
    onChange={e =>{this.props.handlePassword(e); this.handleChange(e)}}
    />
    <button onClick={this.props.handleLoginClick}>Log in</button>
    <button onClick={() => toRegister()}>Don't have an account? Register an account here!</button>
        </li>
  </Grid>
    </Grid>


    
  );
}
